    <div className={classes['filter-container']}>

      <div className={classes.filters}>

        <div class="|">
          <div className={classes['filters__name']}>
            FrontEnd
          </div>
          <div className={classes['filters__action']}>
            <img src={iconRemove} alt='remove icon'></img>
          </div>
        </div>



      </div>

      <div>clear</div>
    </div>
  )
}

